import React from "react";

function Nav() {
  return (
    <div class="ui inverted menu">
      <button class="item">
        Settings
               </button>
      <button class="item">
        Saved Movies
               </button>
      <button class="item">
        Logout
               </button>
    </div>
  );
}

export default Nav;
